package com.neu.myapp.pojo;

public class UniversitySuggest {
	
	private int uniSuggestId;
	private int minGre;
	private int maxGre;
	private int minToefl;
	private float minGpa;
	private float maxGpa;
	private int universityId;
	
	public UniversitySuggest() {
		// TODO Auto-generated constructor stub
	}

	public int getUniSuggestId() {
		return uniSuggestId;
	}

	public void setUniSuggestId(int uniSuggestId) {
		this.uniSuggestId = uniSuggestId;
	}

	public int getMinGre() {
		return minGre;
	}

	public void setMinGre(int minGre) {
		this.minGre = minGre;
	}

	public int getMaxGre() {
		return maxGre;
	}

	public void setMaxGre(int maxGre) {
		this.maxGre = maxGre;
	}

	public int getMinToefl() {
		return minToefl;
	}

	public void setMinToefl(int minToefl) {
		this.minToefl = minToefl;
	}

	public float getMinGpa() {
		return minGpa;
	}

	public void setMinGpa(float minGpa) {
		this.minGpa = minGpa;
	}

	public float getMaxGpa() {
		return maxGpa;
	}

	public void setMaxGpa(float maxGpa) {
		this.maxGpa = maxGpa;
	}

	public int getUniversityId() {
		return universityId;
	}

	public void setUniversityId(int universityId) {
		this.universityId = universityId;
	}
	

}
